import Admin from "./Admin";
import Users from "./Users";


interface IProps{}
interface IState{}

let AdminUserManager:React.FC<IProps> =() =>{

let [adminData, setAdminData] = useState<string>("");
let [userData, setUserData] = useState<string>("");

let reciveDataAdmin = (somedata:string)=>{
    setAdminData((prevState: any)=>{
        return somedata;
    })
}

let reciveDataUser = (somedata:string)=>{
    setUserData((prevState: any)=>{
        return somedata;
    })
}
    return(
        <>
            <div className="grid">
                <div className="container">
                    <div className="row m-4">
                        <div className="col-sm-4">
                            <Admin sendData={reciveDataAdmin} reply={setUserData}/>
                        </div>
                        <div className="col-sm-4">
                            <Users questions={adminData} sendData={reciveDataUser} />
                        </div>
                        <div className="col-sm-4">

                        </div>
                    </div>
                </div>
            </div> 
        </>
    );

}

export default AdminUserManager;
